import Link from 'next/link';
import {Nav,NavbarBrand}from 'reactstrap'
const Navbar = () => (
    
        <nav className="navbar navbar-expand navbar-dark bg-dark mb-4">
        <div className="container">
         <ul>Todo app</ul>   
            
            <style jsx>
                {` ul{background:#87CEEB;
                      font-size :20
                    },
                `}
            </style>
        </div>
        </nav>
    
 
);

export default Navbar;
